import React from "react";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";

const loginForm = ({
  handleLogin,
  username,
  setUsername,
  password,
  setPassword
}) => (
  <form onSubmit={handleLogin}>
    <div>
      {/* Username:
      <input
        type="text"
        value={username}
        name="Username"
        onChange={({ target }) => setUsername(target.value)}
      /> */}
      <TextField
        value={username}
        onChange={({ target }) => setUsername(target.value)}
        label="Username"
        id="username"
      />
    </div>

    <div>
      <TextField
        value={password}
        onChange={({ target }) => setPassword(target.value)}
        label="Password"
        type="password"
        id="password"
      />
    </div>

    <Button
      variant="outlined"
      color="primary"
      type="submit"
      style={{ marginTop: 10 }}
    >
      Login
    </Button>
    <br />
    <br />
  </form>
);

export default loginForm;
